    filterVisitHistory(castId, fromDate, toDate) {
        const visitHistory = this.getVisitHistory();
        return visitHistory.filter(visitHistory => {
            if (visitHistory.accountCastId === castId
                && (visitHistory.entryDate >= fromDate
                && visitHistory.entryDate <= toDate)) {
                return true;
            }
        })
    }

